eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   getPracticeAreaBySlug: () => (/* binding */ getPracticeAreaBySlug),\n/* harmony export */   practiceAreas: () => (/* binding */ practiceAreas)\n/* harmony export */ });\n// app/data/practiceAreas.js\nconst practiceAreas = [\n    {\n        name: \"Constitutional Laws\",\n        icon: \"⚖️\",\n        slug: \"constitutional-laws\",\n        quote: \"However good a Constitution may be, if those who are implementing it are not good, it will prove to be bad. However bad a Constitution may be, if those implementing it are good, it will prove to be good.\",\n        quoteAuthor: \"B. R. Ambedkar\",\n        description: \"Our Constitutional Law practice provides expert legal counsel on fundamental rights, constitutional interpretation, and public law matters. We handle cases involving civil liberties, government powers, and constitutional challenges.\",\n        detailedDescription: [\n            \"The Firm has been consistently and persistently thriving to keep the values and principles of constitution intact at various occasions, where the statutes and rules were falling short to get the justice intact and rule of law uphold in our social parlance. We have been practicing in the constitutional courts of our country since our inception in the profession and have been using the Constitution of India as an instrument to keep the rule of law prevailing in our land.\",\n            \"The Dynamics of Constitutional Law and variance in its applicability with changing time and widespread impact of its fundamental principles in the day-to-day lives of not only citizens, but the people of India can only be understood by studying its relativity with time and method of applicability in respective circumstances.\"\n        ]\n    },\n    {\n        name: \"Civil Litigation\",\n        icon: \"⚖️\",\n        slug: \"civil-litigation\",\n        quote: \"Litigation is the pursuit of practical ends, not a game of chess.\",\n        quoteAuthor: \"Felix Frankfurter\",\n        description: \"Our civil litigation practice handles all types of civil disputes, from commercial conflicts to property matters. We represent clients at all court levels.\",\n        detailedDescription: [\n            \"The Firm has extensive experience in handling litigation of a complex nature. It has a track record of handling landmark cases. The Firm has an in-depth understanding and experience in civil litigation practice, both at the original and appellate side.\",\n            \"The Firm has successfully represented several clients in some of the most complicated and high-stake litigations before various forums such as Supreme Court of India, High Courts, District Courts and Tribunals etc.\",\n            \"The litigation team of the Firm consists of Advocates-on-Record, Advocates, Paralegals and Support Staff.\",\n            \"We work closely with the clients in appreciation of their objectives and assist in formulating strategic and genuine objectives. We have all-round expertise, extensive experience and diverse capabilities in handling a wide range of disputes for domestic and international clients in various courts and tribunals. We represent a variety of clients, including domestic and international corporations, government organisations and private individuals.\"\n        ]\n    },\n    {\n        name: \"Criminal Laws\",\n        icon: \"\\uD83D\\uDEE1️\",\n        slug: \"criminal-laws\",\n        quote: \"Injustice anywhere is a threat to justice everywhere.\",\n        quoteAuthor: \"Martin Luther King\",\n        description: \"Our criminal law practice covers defense and prosecution in all types of criminal cases. We provide comprehensive representation from investigation through trial and appeals.\",\n        detailedDescription: [\n            \"Our Criminal Litigation practice is built on the strength of a team that is not only at the cutting edge of legal knowledge and research skills, but equally has mastered the art of advocacy and cross-examination.\",\n            \"The team prides itself on its diversity and in-depth experience, thus enabling us to consistently deliver the best results. We represent clients across various forums and practice areas ranging from the inquiry & investigation stage right up to the Supreme Court of India, playing a dual role of solicitor and counsel, thus setting us apart from other litigating firms in India.\",\n            \"We have successfully represented our clients in various courts and tribunals in Delhi NCR and across the country as well. Our team consists of some of the best criminal lawyers who have successfully represented our clients in high-stake cases dealing with issues such as criminal trial, quashing of firs, bails, defamation cases, insider trading and market manipulation, white-collar crimes, economic offences, dishonour of cheques, prevention of corruption act, narcotics and drugs violation etc.\"\n        ]\n    },\n    {\n        name: \"Company & Industrial Laws\",\n        icon: \"\\uD83C\\uDFED\",\n        slug: \"company-industrial-laws\",\n        quote: \"The corporate veil of a company should be lifted when the statute itself contemplates lifting it or fraud or improper conduct is intended to be prevented.\",\n        quoteAuthor: \"Supreme Court of India\",\n        description: \"We provide comprehensive legal services for companies and industries, handling corporate governance, industrial disputes, and regulatory compliance.\",\n        detailedDescription: [\n            \"Our team specializes in all aspects of company law, from incorporation and structural changes to complex corporate governance issues. We assist clients in navigating regulatory requirements, ensuring compliance, and managing corporate restructuring processes.\",\n            \"In industrial law matters, we handle labor disputes, workplace safety regulations, industrial relations, and collective bargaining agreements. Our expertise extends to factory compliances, trade union negotiations, and employment-related litigation.\",\n            \"We provide strategic advice on corporate compliance, directors' duties, shareholder rights, board meetings, annual compliances, and regulatory filings. Our services include handling matters before various statutory authorities, including the Ministry of Corporate Affairs, NCLT, and other regulatory bodies.\"\n        ]\n    },\n    {\n        name: \"Media & Entertainment Laws\",\n        icon: \"\\uD83D\\uDCF1\",\n        slug: \"media-entertainment-laws\",\n        description: \"The Firm has exemplary experience across motion pictures, television, talent and celebrity managements, brand endorsements, music, internet and digital media.\",\n        detailedDescription: [\n            \"Our practice spans publishing, outdoor advertising, social media advertising, public relations, amongst others. The entertainment industry operates on a unique combination of strategic know-how, technological and economic finesse, and artistic talent.\",\n            \"Our practice group has the much needed critical access to key players in the industry, providing clients with solution-oriented, business-friendly and dedicated legal advice.\"\n        ]\n    },\n    {\n        name: \"Alternate Dispute Resolution\",\n        icon: \"\\uD83E\\uDD1D\",\n        slug: \"alternate-dispute-resolution\",\n        description: \"Juris Solicio has successfully represented clients in some very challenging litigation and dispute resolution matters involving complex issues of law.\",\n        detailedDescription: [\n            \"Our litigation practice is focused on commercial disputes, civil disputes, shareholders' disputes, enforcement of security, recovery of debts, corporate and securities law, Competition law, labour and employment matters, real estate issues and economic offences.\",\n            \"We handle various corporate, common and criminal issues under the steady gaze of different courts, semi legal experts, and councils, including the Supreme Court of India, High Courts of different States, District Courts and lower courts and exceptional courts.\",\n            \"Aside from a vigorous prosecution practice, the firm additionally exhorts and speaks to customers in other debate goals procedures, for example, global and household intervention, intercession and vital exhortation on potential questions.\",\n            \"Specifically, the association's household and universal assertion practice is well-perceived. This incorporates exhorting on mediations under the Indian discretion enactment (specially appointed assertions) to institutional interventions under the supervision of global intervention focuses, for example, SIAC, LCIA and ICC.\"\n        ]\n    },\n    {\n        name: \"International Law\",\n        icon: \"\\uD83C\\uDF10\",\n        slug: \"international-law\",\n        quote: \"International law is not law in the strict sense; it is a code of conduct of moral force where justice and reasonableness are of supreme importance.\",\n        quoteAuthor: \"H. O. Agarwal\",\n        description: \"Our International Law practice provides comprehensive legal services across borders, handling complex cross-jurisdictional matters, international arbitration, and global trade regulations.\",\n        detailedDescription: [\n            \"In India, International Arbitration & Related Litigation are governed by Indian Arbitration and Conciliation Act,1996, where we have extensive experience in representing clients effectively.\",\n            \"The firm has special expertise in handling arbitration cases in many leading arbitral Institutions including Singapore International Arbitration Centre (SIAC), Hong Kong International Arbitration Centre (HKIAC), Dubai International Arbitration Centre (DIAC), London Court of International Arbitration (LCIA), International arbitration in India, international arbitration as per ICC rules etc.\",\n            \"Our team provides expert counsel on international trade laws, cross-border transactions, foreign investments, and regulatory compliance across multiple jurisdictions. We assist clients in navigating complex international regulations, trade agreements, and dispute resolution mechanisms.\",\n            \"We offer specialized services in international mergers and acquisitions, joint ventures, foreign direct investment, international taxation, and compliance with international business regulations. Our expertise extends to handling matters related to bilateral investment treaties and international commercial contracts.\"\n        ]\n    },\n    {\n        name: \"Electricity Laws\",\n        icon: \"⚡\",\n        slug: \"electricity-laws\",\n        description: \"The Firm has carved a niche for itself in the Electricity Laws. Today, we have a highly qualified team of lawyers available to provide advice on all aspects of projects, pooling their technical know-how and resources to meet the project goals of clients.\",\n        detailedDescription: [\n            \"In addition to helping our clients manage risks through our strong understanding of regulatory issues related to electricity laws, we also work with experts to provide optimum solutions to our clients.\",\n            \"We have experience in transactions and regulatory matters for the electric and gas utility sector before various fora. Our clients include companies involved in every aspect of the energy industry, including transmission, distribution and production.\",\n            \"We also deal in negotiating and drafting the project documents, including Concession Agreements, EPC Contracts, O&M Contracts and financing and security documentation, Power Purchase Agreements, Fuel Supply Agreements, Land Agreements, Construction Agreements, Production Contracts, Implementation Agreement etc.\"\n        ]\n    },\n    {\n        name: \"Real Estate Laws\",\n        icon: \"\\uD83C\\uDFE0\",\n        slug: \"real-estate-laws\",\n        description: \"The Firm offers a diverse range of services in the real estate arena including residential, commercial, industrial, hotels, tourism, special economic zones (SEZs) etc.\",\n        detailedDescription: [\n            \"We have conducted due diligences, advised upon, structured and negotiated on land acquisitions, joint development arrangements, leasing and financing for various types of properties in the case of redevelopments, slum rehabilitation projects, affordable housing projects, government leases, mega food parks, logistic parks, solar projects, integrated townships etc. across states in India.\",\n            \"Our Firm also advises various developers, investors and financing institutions in relation to compliances under Real Estate (Regulation and Development) Act, 2016 (RERA), across different states in India. This includes handholding our clients and working very closely with them for registration of various projects, including discussions with the technical and accounting teams of the developers, wherever required.\",\n            \"Our team has a good understanding and grip on the local real estate laws that may affect projects and real estate transactions across states in the country. Our endeavour is to bridge the gap between addressing legal requirements regulating investments in this sector and tying them to commercially viable solutions.\"\n        ]\n    },\n    {\n        name: \"Banking & Finance Laws\",\n        icon: \"\\uD83D\\uDCB0\",\n        slug: \"banking-finance-laws\",\n        quote: \"Rather than justice for all, we are evolving into a system of justice for those who can afford it. We have banks that are not only too big to fail, but too big to be held accountable.\",\n        quoteAuthor: \"Joseph E. Stiglitz\",\n        description: \"Our Firm has a robust and diverse experience in banking & finance practice. We have advised borrowers, lenders, and security providers and have a deep understanding of legal and commercial issues that may possibly arise in the life of a lending transaction.\",\n        detailedDescription: [\n            \"An in-depth local knowledge of the application of various statutes, with a familiarity of international best practices, allows us to understand and anticipate potential legal and commercial risks that may arise in a transaction.\",\n            \"This coupled with our constant endeavour to restructure, ideate and innovate, enables us to provide effective solutions to all stakeholders in a transaction.\",\n            \"We have successfully handled large, complex and pioneering transactions and our client base includes large public sector and private sector banks and their consortia, global banks, funds and investment houses, asset reconstruction companies as well as domestic and foreign commercial enterprises.\"\n        ]\n    },\n    {\n        name: \"Corporate Laws\",\n        icon: \"\\uD83C\\uDFE2\",\n        slug: \"corporate-laws\",\n        quote: \"Holding individuals accountable for corporate wrongdoing isn't ideological; it's good law enforcement.\",\n        quoteAuthor: \"Sally Yates\",\n        description: \"Our Firm advises clients on the entire spectrum of corporate transactions, including mergers and acquisitions, scheme of arrangement, business and asset transfers, demergers, joint-ventures & strategic alliances, buyouts, reduction of capital, buy-back of shares, stock swap arrangements and corporate reorganisation.\",\n        detailedDescription: [\n            \"Our services are not just restricted to conducting due diligence exercises, drafting and negotiating documents, providing regulatory, corporate compliance solutions, structuring advice, or entry-exit mechanism; we strive, at all points of time, to provide end-to-end results to our clients.\"\n        ]\n    },\n    {\n        name: \"Education Laws\",\n        icon: \"\\uD83C\\uDF93\",\n        slug: \"education-laws\",\n        description: \"India is one of the countries which has a dynamic system in place which is supported by the constantly evolving education policies, procedures and protocol.\",\n        detailedDescription: [\n            \"With years of practice and representing various educational institutions and other organizations engaged in the educational sector, Juris Solicio has gained expertise and experience in handling unique requirements and challenges faced by this sector.\",\n            \"The main and vital areas of its applicability are the administration and operation of educational institutions; finalisation of curriculum and courses; teaching methods; equal opportunities to all students; no discrimination based on race, religion, caste, color, creed, sex, nationality, or disability, for well-rounded personality development of students for a better and bright future.\",\n            \"Among other legal services we also advise setting up of institutions, framing of policies in consonance with the prevalent laws, conciliation and settlements, disciplinary proceeding and dispute resolution in respect of the same.\",\n            \"We mark our presence in the educational sector on a regular basis in various matters across all courts and tribunals including the High Courts and the Supreme Court of India.\"\n        ]\n    },\n    {\n        name: \"Contract Laws\",\n        icon: \"\\uD83D\\uDCDD\",\n        slug: \"contract-laws\",\n        quote: \"When a law is in its nature a contract, when absolute rights have vested under that contract, a repeal of the law cannot divest those rights.\",\n        quoteAuthor: \"John Marshall\",\n        description: \"We help different entities to settle their legitimate cases through securing their rights and benefits. We help companies and individuals to assess legitimate ramifications and dangers based on an international or a local delicate procedure.\",\n        detailedDescription: [\n            \"Our scope of work consists of commercial contracts where we draft, negotiate, implement, vet and take care of any related matter arising out of such contracts.\",\n            \"Our team has the experience and expertise to deal with tenders and contracts related matter, including the weighty suits and arbitrations etc.\"\n        ]\n    },\n    {\n        name: \"Taxation Laws\",\n        icon: \"\\uD83E\\uDDEE\",\n        slug: \"taxation-laws\",\n        description: \"Our Firm has highly qualified attorneys who have accumulated a vast pool of knowledge in Direct and Indirect Tax.\",\n        detailedDescription: [\n            \"Our Firm has the distinction of having assisted some of the largest global conglomerates on a wide spectrum of matters that encompass not only legal advisory but also rigorous strategic decisions.\",\n            \"Our team routinely renders a full spectrum litigation services to clients. The Firm strategizes assists and represents clients in both adjudication as well as appellate proceedings.\",\n            \"The Firm's indirect tax expertise has transitioned itself from the entire gamut of taxes including Excise, Customs, Service Tax, Sales Tax/Value Added Tax (VAT), Entertainment Tax, Entry Tax to recently introduced Goods and Services Tax (GST).\",\n            \"On GST, the Firm has to its credit not just the privilege of having assisted companies with transitioning into GST, but in certain cases hand held the entire industry in the transition process.\",\n            \"We represent our clients before Government Taxation Authorities, Appellate Authorities, High Courts, the Supreme Court of India and other Tribunals. We also represent our clients before the Director General of Foreign Trade, Department of Revenue, Central Board of Excise and Customs and other appropriate authorities.\"\n        ]\n    },\n    {\n        name: \"Insurance Laws\",\n        icon: \"\\uD83D\\uDEE1️\",\n        slug: \"insurance-laws\",\n        quote: \"Insurance is not just a policy; it is a promise of security and peace of mind.\",\n        quoteAuthor: \"Anonymous\",\n        description: \"We provide expert counsel on insurance policies, claims, and disputes, assisting clients in navigating complex regulatory frameworks.\",\n        detailedDescription: [\n            \"Our team handles all aspects of insurance law, including drafting and negotiating insurance contracts, policy reviews, and ensuring regulatory compliance.\",\n            \"We have extensive experience in representing clients in insurance claim disputes, helping them resolve issues effectively in litigation or arbitration.\",\n            \"Our team also advises on risk assessment, liability management, and reinsurance contracts, ensuring clients are protected in all scenarios.\"\n        ]\n    },\n    {\n        name: \"Insolvency & Bankruptcy Laws\",\n        icon: \"\\uD83D\\uDCDC\",\n        slug: \"insolvency-bankruptcy-laws\",\n        description: \"The Firm has been consistently dealing with Insolvency & Bankruptcy Laws in the country with our Partners being recognised as leading individuals in the space in India.\",\n        detailedDescription: [\n            \"The areas covered by the practice extend across India. Our Insolvency & Bankruptcy Law Practice is built on the strength of a team that is not only at the cutting edge of legal knowledge and research skills, but equally has mastered the art of advocacy related to insolvency & bankruptcy procedure.\",\n            \"Our firm has been regularly appearing for their clients in all Company Law Tribunals and helping their clients recover their rightful dues.\",\n            \"The Firm has substantial experience in handling cases for and against financial creditors as well as operational creditors in a time bound and cost-effective manner.\",\n            \"Our firm is representing its clients before the National Company Law Tribunals and also before the National Company Law Appellate Tribunal.\"\n        ]\n    },\n    {\n        name: \"Intellectual Property Rights\",\n        icon: \"\\uD83E\\uDDE0\",\n        slug: \"intellectual-property-rights\",\n        quote: \"Every Trade Mark you Build adds to the financial value of your business, much more than your tangible assets\",\n        quoteAuthor: \"Kalyan C. Kankanala\",\n        description: \"With the advent of the knowledge and information technology era, intellectual capital has gained substantial importance. Consequently, intellectual property (IP) and intellectual property rights (IPRs) attached thereto have become precious commodities and are being fiercely protected.\",\n        detailedDescription: [\n            \"The Intellectual Property Law team of Juris Solicio is led by extremely competent lawyers and comprises individuals with requisite skills to tackle complex legal challenges associated with the protection of intellectual property in the 21st century. The team has formulated comprehensive strategies to help clients protect and leverage their intellectual property and unlock the value of their intellectual assets in the current competitive marketplace.\",\n            \"We represent our clients before all the Courts and Tribunals in the matters related to infringement of intellectual property rights and related disputes. In addition, the Firm has assisted clients in drafting and filing copyright, trademark, design and patent applications in India.\"\n        ]\n    },\n    {\n        name: \"Information Technology Laws\",\n        icon: \"\\uD83D\\uDCBB\",\n        slug: \"information-technology-laws\",\n        description: \"Information Technology Services ('ITS') and Cyber Laws are here to stay and are an integral part of today's globalized world.\",\n        detailedDescription: [\n            \"Data privacy is critical not only for the sectors which actively deal with data, including e-commerce companies, social networks, IT outsourcing units but could also greatly impact other businesses in sectors including hotels and hospitality, insurance, B2C sales, telecom, life sciences, etc.\",\n            \"Additionally, even the entities which seek investment from offshore individual investors need to be mindful of the data protection norms while collecting and storing KYC and other information from such investors.\",\n            \"Our firm has cultivated the ability to provide creative and workable solutions to clients by consciously combining industry knowledge, practical experience and intensive legal research.\",\n            \"We have a dedicated Information Technology practice, that focuses on the legal and regulatory issues that arise in Information Technology Sector. We also deal in cyber law and handle cases like internet fraud, hacking, privacy and security related issues etc.\"\n        ]\n    },\n    {\n        name: \"Power, Energy & Natural Resources\",\n        icon: \"\\uD83D\\uDD0B\",\n        slug: \"power-energy-resources\",\n        quote: \"The energy of the mind is the essence of life, and the power of resources is its lifeline.\",\n        quoteAuthor: \"Aristotle, paraphrased\",\n        description: \"We handle legal matters related to power generation, energy distribution, and natural resource management, ensuring compliance and sustainability.\",\n        detailedDescription: [\n            \"Our team provides comprehensive guidance on regulatory compliance and project development in the energy sector.\",\n            \"We have expertise in negotiating and drafting contracts such as Power Purchase Agreements, Energy Trading Agreements, and Renewable Energy Certificates.\",\n            \"Our experience spans across regulatory disputes, licensing, environmental clearances, and advisory services for renewable and non-renewable energy projects.\"\n        ]\n    },\n    {\n        name: \"Matrimonial & Family Laws\",\n        icon: \"\\uD83D\\uDC68‍\\uD83D\\uDC69‍\\uD83D\\uDC67‍\\uD83D\\uDC66\",\n        slug: \"matrimonial-family-laws\",\n        quote: \"The first Law of Heaven is obedience, and it should be the first law of every home. It is the foundation of an orderly home, a successful family, and the successful lives of the children. The wife is the key\",\n        quoteAuthor: \"Helen Andelin\",\n        description: \"The Firm is well known in the legal industry for its exceptional performance in settlement of matrimonial issues. Handling cases related to separation case through mutual consent, contested divorce, annulment of marriage, child guardianship matters etc.\",\n        detailedDescription: [\n            \"We have special expertise in separation cases and have successfully represented our clients before different courts in Delhi NCR.\",\n            \"We offer complete legal services for disputes related to family law administrations including marriage enlistment or separation, guardianship etc.\",\n            \"We provide comprehensive legal services including in-house counselling to our clients so that they can get one window solution for every kind and at every level of disputes under matrimonial law. We also provide legal consultancy services, prior to dispute so that the dispute can be avoided, besides providing litigation services to them as well.\"\n        ]\n    },\n    {\n        name: \"Environmental & Mining Laws\",\n        icon: \"\\uD83C\\uDF33\",\n        slug: \"environmental-mining-laws\",\n        quote: \"The only way forward, if we are going to improve the quality of the environment, is to get everybody involved.\",\n        quoteAuthor: \"Richard Rogers\",\n        description: \"The Firm offers regulatory advice and policy support related to Environmental Law sector, including contentious litigation support, representing clients before sector regulators, quasi-judicial authorities, commissions and tribunals.\",\n        detailedDescription: [\n            \"Additionally, we provide advocacy support to companies and industry associations.\",\n            \"Our team has a vast experience in dealing with matters related to ecological laws relating to reusing, perilous waste administration (by medical clinics, centres, fabricating ventures and so on.), water and air contamination, woods and timber guidelines, treatment of synthetic concoctions etc.\",\n            \"We further offer well-grounded legal advice and counsel in connection with compliance issues, corporate and financial transactions, and disputes concerning environmental requirements and potential environmental damages.\"\n        ]\n    }\n];\nfunction getPracticeAreaBySlug(slug) {\n    return practiceAreas.find((area)=>area.slug === slug);\n}\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./app/data/practiceAreas.js\n");

